import { css } from "styled-components";

export const HelveticaneueBoldBlack35px = css`
  color: var(--black);
  font-family: var(--font-family-helveticaneue-bold);
  font-size: var(--font-size-xxs);
  font-weight: 700;
  font-style: normal;
`;

export const HelveticaneueCondensedBoldBlack80px = css`
  color: var(--black);
  font-family: var(--font-family-helveticaneue-condensedbold);
  font-size: var(--font-size-xl);
  font-weight: 700;
  font-style: normal;
`;

export const HelveticaneueRegularNormalDoveGray3 = css`
  color: var(--dove-gray);
  font-family: var(--font-family-helveticaneue-regular);
  font-size: var(--font-size-xxs);
  font-weight: 400;
  font-style: normal;
`;

export const HelveticaneueCondensedBoldWhite50px = css`
  color: var(--white);
  font-family: var(--font-family-helveticaneue-condensedbold);
  font-size: var(--font-size-s);
  font-weight: 700;
  font-style: normal;
`;

export const HelveticaneueCondensedBoldCodGray52 = css`
  color: var(--cod-gray);
  font-family: var(--font-family-helveticaneue-condensedbold);
  font-size: var(--font-size-m);
  font-weight: 700;
  font-style: normal;
`;

export const HelveticaneueLightitalicLightBlack3 = css`
  color: var(--black);
  font-family: var(--font-family-helveticaneue-lightitalic);
  font-size: var(--font-size-xs);
  font-weight: 300;
  font-style: italic;
`;

export const HelveticaneueBoldCodGray52px = css`
  color: var(--cod-gray);
  font-family: var(--font-family-helvetica_neue);
  font-size: var(--font-size-m);
`;

export const HelveticaneueCondensedBoldCodGray31 = css`
  color: var(--cod-gray);
  font-family: var(--font-family-helveticaneue-condensedbold);
  font-size: var(--font-size-xxxs);
  font-weight: 700;
  font-style: normal;
`;

export const HelveticaneueBoldBlack60px = css`
  color: var(--black);
  font-family: var(--font-family-helveticaneue-bold);
  font-size: var(--font-size-l);
  font-weight: 700;
  font-style: normal;
`;

export const Border1pxDoveGray = css`
  border: 1px solid var(--dove-gray);
`;
